@matthewsamuda @NWCjam 
OPEN LETTER TO WINDALCO:
I hope that you are fully satisfied making the Emancipation weekend of Spanish Town residents very uncomfortable. You continue to defy @nepajamaica directives &amp; have your own way polluting the Rio Cobre with no regard for anyone!!

